INSERT INTO `zt_faq` VALUES (1,4,1,'如何从Windows的禅道中将数据导出到Linux的禅道中？','<span style=\"color:#333333;\">参考我们的 </span><a href=\"https://www.zentao.net/help-read-78961.html\" target=\"_blank\" rel=\"noreferrer noopener\">备份文档</a><span style=\"color:#333333;\">。主要是数据库和附件。</span><br /><p style=\"color:#333333;\">先在linux下搭建同版本的禅道，然后把数据库和附件（zentao/www/data/upload）迁移过去。<br />数据库可以直接拷贝数据库的物理文件。<br />自己搭建环境，mysql物理文件目录一般在 /var/lib/mysql/ 。如果是集成包，就在集成包里面，具体看mysql的配置文件。</p>\n<p style=\"color:#333333;\">迁移介绍视频：http://www.zentao.net/video/c1456/p3.html</p>','2021-06-25 16:53:21'),(2,4,1,'一个项目可以导入另外一个项目中的，进行中的需求，任务 和 未关闭的bug 么？','<p style=\"color:#333333;\">1、项目-任务 右上角点击按钮 导入-转入任务 。需要满足4个条件：1、新的项目和老的项目必须关联同一个产品；2、不能导入子任务；3、任务状态是以下状态中的一种：未开始、进行中、暂停、取消；4、如果任务关联了需求，那新的项目必须也关联这个需求所在的产品（如果是多平台/多分支产品，还需要新的项目关联了需求所在的平台/分支）。</p>\n<p style=\"color:#333333;\">2、任务导入后之前项目中就看不到具体的任务了。</p>\n<p style=\"color:#333333;\">3、导入bug是把bug导入成一个任务，之前的bug还在的，当修改任务状态为完成的时候会提示是否要修改相关bug的状态。bug之前的关联的需求和任务不发生变化。</p>','2021-06-25 17:05:21'),(3,4,1,'云服务器启动xxd提示 WebSocket server listen err 。','<span style=\"color:#333333;\">是因为机器上并没有这个ip地址，是服务商通过路由机制转发的。解决方法是将监听ip设置为：0.0.0.0 。</span>','2021-06-25 17:07:22'),(4,4,1,'任务的”转入任务“功能，需要哪些条件？','<p style=\"color:#333333;\">1. 之前的项目已经过期或者结束；</p>\n<p style=\"color:#333333;\">2. 当前帐号有权限访问之前项目；</p>\n<p style=\"color:#333333;\">3. 如果任务有关联需求，需要新的项目关联任务所关联需求所在的产品；&nbsp;</p>\n<p style=\"color:#333333;\">4. 之前项目有未完成的任务，只能导入未完成的任务。</p>','2021-06-25 17:08:11'),(5,4,1,'禅道数据库结构（数据字典）在可以可以查看？','<span style=\"color:#333333;\">可以在 后台-二次开发-数据库中 查看数据库结构及相应字段的含义。</span>','2021-06-25 17:08:57'),(6,4,1,'禅道的API接口有哪些？','<p style=\"color:#333333;\">可以到 后台-二次开发-api 中查看相应的api接口介绍。</p>\n<p style=\"color:#333333;\">api接口的调用可以参考文档：&nbsp;<a href=\"http://devel.cnezsoft.com/book/extension/api-intro-43.html\" target=\"_blank\" rel=\"noreferrer noopener\">http://devel.cnezsoft.com/book/extension/api-intro-43.html</a>&nbsp;和&nbsp;<a href=\"http://devel.cnezsoft.com/book/extension/api-auth-44.html\" target=\"_blank\" rel=\"noreferrer noopener\">http://devel.cnezsoft.com/book/extension/api-auth-44.html</a></p>','2021-06-25 17:09:14');
/*!40000 ALTER TABLE `zt_faq` ENABLE KEYS */;
