计划与发布的子需求','001- <del>路线图需要同时显示未过期的计划与发布的子需求1</del>\n001+ <ins>路线图中显示未过期的计划与发布的子需求</ins>'),(102,195,'version','1','2',''),(103,196,'name','路线图需要同时显示未过期的计划与发布的子需求2 ','显示未过期的计划与发布任务2','001- <del>路线图需要同时显示未过期的计划与发布的子需求2</del>\n001+ <ins>显示未过期的计划与发布任务2</ins>'),(104,196,'version','1','2',''),(105,197,'name','路线图中显示未过期的计划与发布的子需求','显示未过期的计划与发布的子需求任务1','001- <del>路线图中显示未过期的计划与发布的子需求</del>\n001+ <ins>显示未过期的计划与发布的子需求任务1</ins>'),(106,197,'version','2','3',''),(107,198,'name','显示未过期的计划与发布的子需求任务1','显示未过期的计划与发布任务1','001- <del>显示未过期的计划与发布的子需求任务1</del>\n001+ <ins>显示未过期的计划与发布任务1</ins>'),(108,198,'version','3','4',''),(109,204,'content','','<p style=\"color:#333333;\">为了简化大家在windows下面的安装，我们在xampp基础上做了禅道的windows一键安装包。xampp是业内非常著名的AMP集成运行环境。禅道的一键安装包主要在它基础上做了大量的精简，并集成了我们自主开发的集成面板，使用起来会更加方便。关于xampp一键安装包，大家有兴趣可以访问下面的官方网站：<a target=\"_blank\" href=\"https://www.apachefriends.org/\" rel=\"noreferrer noopener\">https://www.apachefriends.org/</a>&nbsp;（注：这个是xampp官方网站，禅道一<span style=\"line-height:24.4444px;\">键</span>安装包不需要登录这个网址下载）。</p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\">禅道9.2.stable版本升级了Windows一键安装包。</p>\n<p style=\"color:#333333;\">禅道运行集成面板升级到2.0.0版本，我们有针对64位和32位分别打包，请根据自己的电脑下载对应的Windows一键安装包。</p>\n<p style=\"color:#333333;\">启用Apache用户验证，修改mysql密码的功能，新安装时会提示安装VC环境。</p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">注：</span></span></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">windows一键安装包中已经集成了XXD服务，不需要再单独安装部署XXD。windows操作系统，server版本建议采用2012或2016及以上。</span></span></p>\n<h4>一、Windows 64/32位一键安装包的安装<br /></h4>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">1、运行Windows一键安装包</span></p>\n<p style=\"color:#333333;\">在我们的站点下载新的windows集成运行环境(.exe结尾)。<br /><span style=\"font-weight:700;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp， 必须是根目录。</span><br />&nbsp;进入xampp文件夹，点击 start.exe启动禅道时，如果电脑没有安装过VC运行环境时，会提示安装VC  环境。</p>\n<p style=\"color:#333333;\">Windows一键安装包的运行需要安装VC  环境。</p>\n<p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201705/f_fa49d52b26735bfd17260694410e7098.png\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"background-color:#FFE500;\">注意：</span><span style=\"background-color:#FFE500;\">如果您遇到以下界面，请删除当前xampp包，然后下载&nbsp;</span><span style=\"font-weight:700;\"><span style=\"background-color:#FFE500;\">windows一键安装包（未加安全设置）</span></span><span style=\"background-color:#FFE500;\">的包安装使用。</span></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_c44c31da4a8af894172aaa641fd88306&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_bc7323ac7ce0a47b11ce9dace87b91d2&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_da7f0402e6e83958e2528bd9ae358f06&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">2、修改数据库密码</span></p>\n<p style=\"color:#333333;\">禅道服务启动后，会提示数据库密码太弱，建议修改密码。</p>\n<p style=\"color:#333333;\">会默认显示一个密码，你也可以自己设置一个密码，点OK后数据库密码会自动修改。</p>\n<p style=\"color:#333333;\">可以在控制运行面板左上角服务--修改数据库密码里查看到当前的数据库密码。也可以在xampp/zentao/config/my.php里查看到数据库密码。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_185c49b6ffbf4cbf2565cafab8231bc1&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">3、</span><span style=\"font-weight:700;\">Apache用户访问验证（注：未加安全设置的一键安装包无此功能）</span></p>\n<p style=\"color:#333333;\">禅道启动后，默认是开启了Apache用户访问验证，如下图：</p>\n<ul style=\"color:#333333;\"><li>如果不想开启访问验证功能，可以把<span style=\"font-weight:700;\">集成面板最后一行左侧</span>的对号去掉。<br /></li>\n</ul><ul style=\"color:#333333;\"><li>启用访问验证后，用户需要先输入集成面板最后一行的帐号密码（此帐号密码需要提供给所有禅道登录人员）才可以访问到禅道登录页面（登录页面需要输入禅道的登录帐号方可登录，默认登录禅道帐号：admin 123456）。<img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_c9c763f3eb0a20a2eaf6c0434cbc9617.png\" alt=\"\" width=\"424\" height=\"243\" /><img src=\"https://www.zentao.net/file.php?f=201807/f_426d924218c2fb46b500b5e46993733c&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /><br /></li>\n</ul><ul style=\"color:#333333;\"><li>如果需要修改Apache用户访问验证的账号和密码，可以在运行集成面板<span style=\"font-weight:700;\">最后一行的“更改”按钮</span>&nbsp;进行修改。</li>\n</ul><p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_6fd4ebe00fba6044636b8968cb565f82.png\" alt=\"\" width=\"424\" height=\"41\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">4、超级管理员登录密码修改</span></p>\n<p style=\"color:#333333;\">超级管理员登录禅道后，一键安装包默认的账号密码是admin，123456。</p>\n<p style=\"color:#333333;\">系统会检测密码安全级别，提示修改弱口令密码，按照提示修改即可。</p>\n<p style=\"color:#333333;\">如果需要维护密码安全设置可以到&nbsp;<span style=\"font-weight:700;\">后台--安全</span>&nbsp;页面进行修改。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_f42a26fa7d182d4cbb31fd9e2e7e917e&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_6b02c43743b66b9468396e004f27c2e0&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">5、登录禅道数据库</span></p>\n<p style=\"color:#333333;\">禅道Windows一键安装包默认只能在服务器本机登录。</p>\n<p style=\"color:#333333;\">浏览器里输入<span style=\"font-weight:700;\">http://127.0.0.1:端口号（apache端口为非80端口时，需要填写端口号）</span>，然后点击登录页面左下的&nbsp;<span style=\"font-weight:700;\">数据库管理</span>。</p>\n<p style=\"color:#333333;\">即可进入禅道数据库登录页面。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_8da45dcf4b40c0f0fe72baa0fd60f3c4.png&amp;t=png\" alt=\"\" width=\"550\" height=\"276\" /></p>\n<p style=\"color:#333333;\">在登录页面填写<span style=\"font-weight:700;\">&nbsp;xampp/zentao/config/my.php</span>&nbsp;里的对应参数，即可进入禅道数据库。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">系 &nbsp; &nbsp;统：</span>默认选择MySQL。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">服务器：</span>对应填写下图的$config-&gt;db-&gt;host和port的参数。比如下图$config-&gt;db-&gt;host = \'127.0.0.1\'，$config-&gt;db-&gt;port = \'3306\'。那么服务器填写：127.0.0.1:3306。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">用户名：</span>对应填写下图的$config-&gt;db-&gt;user = \'zentao\'。那么用户名就应该填写zentao。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">密 &nbsp; &nbsp;码：</span>对应填写下图的$config-&gt;db-&gt;password = \' \'，中单引号里的值。（每个人的数据库密码会不一样，单引号里显示的值是什么，密码就填写什么）</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">数据库：</span>对应填写下图的$config-&gt;db-&gt;name = \'zentao \'中的zentao 。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_66d27bd958b83d2c6986186826cd2c1a.png&amp;t=png\" alt=\"\" width=\"469\" height=\"293\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">需要注意的情况：</span></p>\n<p style=\"color:#333333;\">如果准备登录禅道数据库时，<span style=\"font-weight:700;\">登录界面里显示为黄底的内容，是浏览器自动填充的数据</span>。</p>\n<p style=\"color:#333333;\">这里填充的用户名和密码，其实和禅道的数据库用户名和密码是不一样的。</p>\n<p style=\"color:#333333;\">如果不做修改直接登录的话，是没有办法登录到禅道数据库的。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">请按照以上的说明，填写禅道数据库登录的参数。</span></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_665b750ae4dba727842580e6266a2dba.png&amp;t=png\" alt=\"\" width=\"608\" height=\"307\" /></p>\n<h4>二、未加安全设置的Windows一键安装包的安装(9.2.stable以上版本的未加安全设置包 9.2.stable以前的一键安装包）</h4>\n<p style=\"color:#333333;\">2.1 在我们的站点下载新的windows集成运行环境(.exe结尾)。</p>\n<p style=\"color:#333333;\">2.2<span style=\"color:#E56600;\">&nbsp;</span><span style=\"font-weight:700;\"><span style=\"color:#E56600;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp，</span><span style=\"color:#E56600;\">&nbsp;</span><span style=\"color:#E56600;\">必须是根目录</span><span style=\"color:#E56600;\">。</span></span></p>\n<p style=\"color:#333333;\">2.3 进入xampp文件夹，双击start.bat（新的windows一键安装包右键以管理员身份运行 启动禅道.exe）启动集成面板程序，界面如下：<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_c791981d982ba2b62264624cf33a554a.png\" alt=\"\" width=\"393\" height=\"258\" /></p>\n<p style=\"color:#333333;\">2.4 修改apache和mysql的启动端口(注意：默认系统会自动切换可以使用的端口，如果需要指定特定端口可以按以下步骤操作)：<br />1)、点击集成面板（运行xampp/启动禅道.exe后出现的控制台）左上角 服务-卸载服务；<br />2)、点击集成面板左上角 服务-配置默认端口，修改端口号后保存；<br />3)、退出集成面板后重新以管理员身份运行 xampp/启动禅道.exe；<br />4)、点击启动禅道。</p>\n<h4>三、启动并访问禅道</h4>\n<p style=\"color:#333333;\">3.1 启动集成面板之后，点击“启动禅道”按钮，系统会自动启动禅道所需要的apache和mysql服务。</p>\n<p style=\"color:#333333;\">3.2 启动成功之后，点击“访问禅道”，即可打开禅道环境的首页。5秒钟之后，页面会自动跳转到禅道的页面。<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_7f380746603ace52684a81d2f7bd9258.png\" alt=\"\" width=\"435\" height=\"180\" /></p>\n<p style=\"color:#333333;\">3.3 修改端口操作步骤：运行 xampp/start.exe 后 左上角 服务-卸载服务&nbsp; 然后 服务-配置默认端口 保存后 退出重新运行 xampp/start.exe&nbsp; 点击 启动禅道 。</p>\n<h4>四、相关密码</h4>\n<p style=\"color:#333333;\">4.1 禅道项目管理软件的登录帐号是<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">admin</span></span>,密码是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">123456</span></span>，请登录之后尽快修改自己的密码。</p>\n<p style=\"color:#333333;\">4.2 mysql数据库的管理员默认帐号是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">root</span></span>，密码为<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">&nbsp;123456</span></span>。(如果您修改了root帐号的密码，请一定记得修改zentao/config/my.php里面的数据库密码)</p>\n<p style=\"color:#333333;\">4.3&nbsp;数据库管理是使用的phpmyadmin程序，基于安全方面的考虑，只能在禅道所在的机器上面访问，从其他机器访问会被禁止。（禅道服务器本机浏览器访问127.0.0.1，点击数据库管理。）</p>\n<h4>五、关于该环境</h4>\n<p style=\"color:#333333;\">5.1 禅道访问地址为<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">http://禅道机器的ip地址:端口号/zentao/</span></span>，ip地址换成禅道机器实际的ip地址，端口号换成实际的端口号。（查看电脑IP地址方法：http://jingyan.baidu.com/article/63f2362816d56c0208ab3dd5.html）</p>\n<p style=\"color:#333333;\">5.2 该集成面板会自动安装apache和mysql为服务，服务名分别是apachezt, mysqlzt。</p>\n<p style=\"color:#333333;\">5.3 该环境是从<a href=\"http://www.apachefriends.org/\" target=\"_blank\" rel=\"noreferrer noopener\">xampp</a>版本精简而来。</p>\n<h4>六、如果集成面板失败</h4>\n<p style=\"color:#333333;\">如果无法通过集成面板启动禅道程序，我们还提供了命令行的控制脚本来启动禅道：</p>\n<p style=\"color:#333333;\">6.1 切换到xampp\\service目录</p>\n<p style=\"color:#333333;\">6.2&nbsp;双击install.bat这个脚本，系统会自动尝试安装apache和mysql为服务，并启动。</p>\n<p style=\"color:#333333;\">6.3&nbsp;安装成功之后，在这个目录下面会有port.apache和port.mysql来记录apache和mysql的端口号，如果您想更改端口，可以将这两个文件删掉，重新运行install.bat脚本。</p>','001- <del></del>\n001+ <ins><p style=\"color:#333333;\">为了简化大家在windows下面的安装，我们在xampp基础上做了禅道的windows一键安装包。xampp是业内非常著名的AMP集成运行环境。禅道的一键安装包主要在它基础上做了大量的精简，并集成了我们自主开发的集成面板，使用起来会更加方便。关于xampp一键安装包，大家有兴趣可以访问下面的官方网站：<a target=\"_blank\" href=\"https://www.apachefriends.org/\" rel=\"noreferrer noopener\">https://www.apachefriends.org/</a>（注：这个是xampp官方网站，禅道一<span style=\"line-height:24.4444px;\">键</span>安装包不需要登录这个网址下载）。</p></ins>\n002+ <ins><p style=\"color:#333333;\"><br /></p></ins>\n003+ <ins><p style=\"color:#333333;\">禅道9.2.stable版本升级了Windows一键安装包。</p></ins>\n004+ <ins><p style=\"color:#333333;\">禅道运行集成面板升级到2.0.0版本，我们有针对64位和32位分别打包，请根据自己的电脑下载对应的Windows一键安装包。</p></ins>\n005+ <ins><p style=\"color:#333333;\">启用Apache用户验证，修改mysql密码的功能，新安装时会提示安装VC环境。</p></ins>\n006+ <ins><p style=\"color:#333333;\"><br /></p></ins>\n007+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">注：</span></span></p></ins>\n008+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">windows一键安装包中已经集成了XXD服务，不需要再单独安装部署XXD。windows操作系统，server版本建议采用2012或2016及以上。</span></span></p></ins>\n009+ <ins><h4>一、Windows 64/32位一键安装包的安装<br /></h4></ins>\n010+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">1、运行Windows一键安装包</span></p></ins>\n011+ <ins><p style=\"color:#333333;\">在我们的站点下载新的windows集成运行环境(.exe结尾)。<br /><span style=\"font-weight:700;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp， 必须是根目录。</span><br />进入xampp文件夹，点击 start.exe启动禅道时，如果电脑没有安装过VC运行环境时，会提示安装VC  环境。</p></ins>\n012+ <ins><p style=\"color:#333333;\">Windows一键安装包的运行需要安装VC  环境。</p></ins>\n013+ <ins><p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201705/f_fa49d52b26735bfd17260694410e7098.png\" alt=\"\" /></p></ins>\n014+ <ins><p style=\"color:#333333;\"><span style=\"background-color:#FFE500;\">注意：</span><span style=\"background-color:#FFE500;\">如果您遇到以下界面，请删除当前xampp包，然后下载</span><span style=\"font-weight:700;\"><span style=\"background-color:#FFE500;\">windows一键安装包（未加安全设置）</span></span><span style=\"background-color:#FFE500;\">的包安装使用。</span></p></ins>\n015+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_c44c31da4a8af894172aaa641fd88306&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p></ins>\n016+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_bc7323ac7ce0a47b11ce9dace87b91d2&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p></ins>\n017+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_da7f0402e6e83958e2528bd9ae358f06&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p></ins>\n018+ <ins><p style=\"color:#333333;\"><br /></p></ins>\n019+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">2、修改数据库密码</span></p></ins>\n020+ <ins><p style=\"color:#333333;\">禅道服务启动后，会提示数据库密码太弱，建议修改密码。</p></ins>\n021+ <ins><p style=\"color:#333333;\">会默认显示一个密码，你也可以自己设置一个密码，点OK后数据库密码会自动修改。</p></ins>\n022+ <ins><p style=\"color:#333333;\">可以在控制运行面板左上角服务--修改数据库密码里查看到当前的数据库密码。也可以在xampp/zentao/config/my.php里查看到数据库密码。</p></ins>\n023+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_185c49b6ffbf4cbf2565cafab8231bc1&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p></ins>\n024+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">3、</span><span style=\"font-weight:700;\">Apache用户访问验证（注：未加安全设置的一键安装包无此功能）</span></p></ins>\n025+ <ins><p style=\"color:#333333;\">禅道启动后，默认是开启了Apache用户访问验证，如下图：</p></ins>\n026+ <ins><ul style=\"color:#333333;\"><li>如果不想开启访问验证功能，可以把<span style=\"font-weight:700;\">集成面板最后一行左侧</span>的对号去掉。<br /></li></ins>\n027+ <ins></ul><ul style=\"color:#333333;\"><li>启用访问验证后，用户需要先输入集成面板最后一行的帐号密码（此帐号密码需要提供给所有禅道登录人员）才可以访问到禅道登录页面（登录页面需要输入禅道的登录帐号方可登录，默认登录禅道帐号：admin 123456）。<img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_c9c763f3eb0a20a2eaf6c0434cbc9617.png\" alt=\"\" width=\"424\" height=\"243\" /><img src=\"https://www.zentao.net/file.php?f=201807/f_426d924218c2fb46b500b5e46993733c&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /><br /></li></ins>\n028+ <ins></ul><ul style=\"color:#333333;\"><li>如果需要修改Apache用户访问验证的账号和密码，可以在运行集成面板<span style=\"font-weight:700;\">最后一行的“更改”按钮</span>进行修改。</li></ins>\n029+ <ins></ul><p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_6fd4ebe00fba6044636b8968cb565f82.png\" alt=\"\" width=\"424\" height=\"41\" /></p></ins>\n030+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">4、超级管理员登录密码修改</span></p></ins>\n031+ <ins><p style=\"color:#333333;\">超级管理员登录禅道后，一键安装包默认的账号密码是admin，123456。</p></ins>\n032+ <ins><p style=\"color:#333333;\">系统会检测密码安全级别，提示修改弱口令密码，按照提示修改即可。</p></ins>\n033+ <ins><p style=\"color:#333333;\">如果需要维护密码安全设置可以到<span style=\"font-weight:700;\">后台--安全</span>页面进行修改。</p></ins>\n034+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_f42a26fa7d182d4cbb31fd9e2e7e917e&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p></ins>\n035+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_6b02c43743b66b9468396e004f27c2e0&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p></ins>\n036+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">5、登录禅道数据库</span></p></ins>\n037+ <ins><p style=\"color:#333333;\">禅道Windows一键安装包默认只能在服务器本机登录。</p></ins>\n038+ <ins><p style=\"color:#333333;\">浏览器里输入<span style=\"font-weight:700;\">http://127.0.0.1:端口号（apache端口为非80端口时，需要填写端口号）</span>，然后点击登录页面左下的<span style=\"font-weight:700;\">数据库管理</span>。</p></ins>\n039+ <ins><p style=\"color:#333333;\">即可进入禅道数据库登录页面。</p></ins>\n040+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_8da45dcf4b40c0f0fe72baa0fd60f3c4.png&amp;t=png\" alt=\"\" width=\"550\" height=\"276\" /></p></ins>\n041+ <ins><p style=\"color:#333333;\">在登录页面填写<span style=\"font-weight:700;\">xampp/zentao/config/my.php</span>里的对应参数，即可进入禅道数据库。</p></ins>\n042+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">系  统：</span>默认选择MySQL。</p></ins>\n043+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">服务器：</span>对应填写下图的$config-&gt;db-&gt;host和port的参数。比如下图$config-&gt;db-&gt;host = \'127.0.0.1\'，$config-&gt;db-&gt;port = \'3306\'。那么服务器填写：127.0.0.1:3306。</p></ins>\n044+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">用户名：</span>对应填写下图的$config-&gt;db-&gt;user = \'zentao\'。那么用户名就应该填写zentao。</p></ins>\n045+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">密  码：</span>对应填写下图的$config-&gt;db-&gt;password = \' \'，中单引号里的值。（每个人的数据库密码会不一样，单引号里显示的值是什么，密码就填写什么）</p></ins>\n046+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">数据库：</span>对应填写下图的$config-&gt;db-&gt;name = \'zentao \'中的zentao 。</p></ins>\n047+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_66d27bd958b83d2c6986186826cd2c1a.png&amp;t=png\" alt=\"\" width=\"469\" height=\"293\" /></p></ins>\n048+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">需要注意的情况：</span></p></ins>\n049+ <ins><p style=\"color:#333333;\">如果准备登录禅道数据库时，<span style=\"font-weight:700;\">登录界面里显示为黄底的内容，是浏览器自动填充的数据</span>。</p></ins>\n050+ <ins><p style=\"color:#333333;\">这里填充的用户名和密码，其实和禅道的数据库用户名和密码是不一样的。</p></ins>\n051+ <ins><p style=\"color:#333333;\">如果不做修改直接登录的话，是没有办法登录到禅道数据库的。</p></ins>\n052+ <ins><p style=\"color:#333333;\"><span style=\"font-weight:700;\">请按照以上的说明，填写禅道数据库登录的参数。</span></p></ins>\n053+ <ins><p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_665b750ae4dba727842580e6266a2dba.png&amp;t=png\" alt=\"\" width=\"608\" height=\"307\" /></p></ins>\n054+ <ins><h4>二、未加安全设置的Windows一键安装包的安装(9.2.stable以上版本的未加安全设置包 9.2.stable以前的一键安装包）</h4></ins>\n055+ <ins><p style=\"color:#333333;\">2.1 在我们的站点下载新的windows集成运行环境(.exe结尾)。</p></ins>\n056+ <ins><p style=\"color:#333333;\">2.2<span style=\"color:#E56600;\"></span><span style=\"font-weight:700;\"><span style=\"color:#E56600;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp，</span><span style=\"color:#E56600;\"></span><span style=\"color:#E56600;\">必须是根目录</span><span style=\"color:#E56600;\">。</span></span></p></ins>\n057+ <ins><p style=\"color:#333333;\">2.3 进入xampp文件夹，双击start.bat（新的windows一键安装包右键以管理员身份运行 启动禅道.exe）启动集成面板程序，界面如下：<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_c791981d982ba2b62264624cf33a554a.png\" alt=\"\" width=\"393\" height=\"258\" /></p></ins>\n058+ <ins><p style=\"color:#333333;\">2.4 修改apache和mysql的启动端口(注意：默认系统会自动切换可以使用的端口，如果需要指定特定端口可以按以下步骤操作)：<br />1)、点击集成面板（运行xampp/启动禅道.exe后出现的控制台）左上角 服务-卸载服务；<br />2)、点击集成面板左上角 服务-配置默认端口，修改端口号后保存；<br />3)、退出集成面板后重新以管理员身份运行 xampp/启动禅道.exe；<br />4)、点击启动禅道。</p></ins>\n059+ <ins><h4>三、启动并访问禅道</h4></ins>\n060+ <ins><p style=\"color:#333333;\">3.1 启动集成面板之后，点击“启动禅道”按钮，系统会自动启动禅道所需要的apache和mysql服务。</p></ins>\n061+ <ins><p style=\"color:#333333;\">3.2 启动成功之后，点击“访问禅道”，即可打开禅道环境的首页。5秒钟之后，页面会自动跳转到禅道的页面。<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_7f380746603ace52684a81d2f7bd9258.png\" alt=\"\" width=\"435\" height=\"180\" /></p></ins>\n062+ <ins><p style=\"color:#333333;\">3.3 修改端口操作步骤：运行 xampp/start.exe 后 左上角 服务-卸载服务 然后 服务-配置默认端口 保存后 退出重新运行 xampp/start.exe 点击 启动禅道 。</p></ins>\n063+ <ins><h4>四、相关密码</h4></ins>\n064+ <ins><p style=\"color:#333333;\">4.1 禅道项目管理软件的登录帐号是<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">admin</span></span>,密码是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">123456</span></span>，请登录之后尽快修改自己的密码。</p></ins>\n065+ <ins><p style=\"color:#333333;\">4.2 mysql数据库的管理员默认帐号是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">root</span></span>，密码为<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">123456</span></span>。(如果您修改了root帐号的密码，请一定记得修改zentao/config/my.php里面的数据库密码)</p></ins>\n066+ <ins><p style=\"color:#333333;\">4.3数据库管理是使用的phpmyadmin程序，基于安全方面的考虑，只能在禅道所在的机器上面访问，从其他机器访问会被禁止。（禅道服务器本机浏览器访问127.0.0.1，点击数据库管理。）</p></ins>\n067+ <ins><h4>五、关于该环境</h4></ins>\n068+ <ins><p style=\"color:#333333;\">5.1 禅道访问地址为<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">http://禅道机器的ip地址:端口号/zentao/</span></span>，ip地址换成禅道机器实际的ip地址，端口号换成实际的端口号。（查看电脑IP地址方法：http://jingyan.baidu.com/article/63f2362816d56c0208ab3dd5.html）</p></ins>\n069+ <ins><p style=\"color:#333333;\">5.2 该集成面板会自动安装apache和mysql为服务，服务名分别是apachezt, mysqlzt。</p></ins>\n070+ <ins><p style=\"color:#333333;\">5.3 该环境是从<a href=\"http://www.apachefriends.org/\" target=\"_blank\" rel=\"noreferrer noopener\">xampp</a>版本精简而来。</p></ins>\n071+ <ins><h4>六、如果集成面板失败</h4></ins>\n072+ <ins><p style=\"color:#333333;\">如果无法通过集成面板启动禅道程序，我们还提供了命令行的控制脚本来启动禅道：</p></ins>\n073+ <ins><p style=\"color:#333333;\">6.1 切换到xampp\\service目录</p></ins>\n074+ <ins><p style=\"color:#333333;\">6.2双击install.bat这个脚本，系统会自动尝试安装apache和mysql为服务，并启动。</p></ins>\n075+ <ins><p style=\"color:#333333;\">6.3安装成功之后，在这个目录下面会有port.apache和port.mysql来记录apache和mysql的端口号，如果您想更改端口，可以将这两个文件删掉，重新运行install.bat脚本。</p></ins>'),(110,204,'module','','0',''),(111,205,'content','<p style=\"color:#333333;\">为了简化大家在windows下面的安装，我们在xampp基础上做了禅道的windows一键安装包。xampp是业内非常著名的AMP集成运行环境。禅道的一键安装包主要在它基础上做了大量的精简，并集成了我们自主开发的集成面板，使用起来会更加方便。关于xampp一键安装包，大家有兴趣可以访问下面的官方网站：<a target=\"_blank\" href=\"https://www.apachefriends.org/\" rel=\"noreferrer noopener\">https://www.apachefriends.org/</a>&nbsp;（注：这个是xampp官方网站，禅道一<span style=\"line-height:24.4444px;\">键</span>安装包不需要登录这个网址下载）。</p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\">禅道9.2.stable版本升级了Windows一键安装包。</p>\n<p style=\"color:#333333;\">禅道运行集成面板升级到2.0.0版本，我们有针对64位和32位分别打包，请根据自己的电脑下载对应的Windows一键安装包。</p>\n<p style=\"color:#333333;\">启用Apache用户验证，修改mysql密码的功能，新安装时会提示安装VC环境。</p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">注：</span></span></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">windows一键安装包中已经集成了XXD服务，不需要再单独安装部署XXD。windows操作系统，server版本建议采用2012或2016及以上。</span></span></p>\n<h4>一、Windows 64/32位一键安装包的安装<br /></h4>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">1、运行Windows一键安装包</span></p>\n<p style=\"color:#333333;\">在我们的站点下载新的windows集成运行环境(.exe结尾)。<br /><span style=\"font-weight:700;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp， 必须是根目录。</span><br />&nbsp;进入xampp文件夹，点击 start.exe启动禅道时，如果电脑没有安装过VC运行环境时，会提示安装VC  环境。</p>\n<p style=\"color:#333333;\">Windows一键安装包的运行需要安装VC  环境。</p>\n<p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201705/f_fa49d52b26735bfd17260694410e7098.png\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"background-color:#FFE500;\">注意：</span><span style=\"background-color:#FFE500;\">如果您遇到以下界面，请删除当前xampp包，然后下载&nbsp;</span><span style=\"font-weight:700;\"><span style=\"background-color:#FFE500;\">windows一键安装包（未加安全设置）</span></span><span style=\"background-color:#FFE500;\">的包安装使用。</span></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_c44c31da4a8af894172aaa641fd88306&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_bc7323ac7ce0a47b11ce9dace87b91d2&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_da7f0402e6e83958e2528bd9ae358f06&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">2、修改数据库密码</span></p>\n<p style=\"color:#333333;\">禅道服务启动后，会提示数据库密码太弱，建议修改密码。</p>\n<p style=\"color:#333333;\">会默认显示一个密码，你也可以自己设置一个密码，点OK后数据库密码会自动修改。</p>\n<p style=\"color:#333333;\">可以在控制运行面板左上角服务--修改数据库密码里查看到当前的数据库密码。也可以在xampp/zentao/config/my.php里查看到数据库密码。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_185c49b6ffbf4cbf2565cafab8231bc1&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">3、</span><span style=\"font-weight:700;\">Apache用户访问验证（注：未加安全设置的一键安装包无此功能）</span></p>\n<p style=\"color:#333333;\">禅道启动后，默认是开启了Apache用户访问验证，如下图：</p>\n<ul style=\"color:#333333;\"><li>如果不想开启访问验证功能，可以把<span style=\"font-weight:700;\">集成面板最后一行左侧</span>的对号去掉。<br /></li>\n</ul><ul style=\"color:#333333;\"><li>启用访问验证后，用户需要先输入集成面板最后一行的帐号密码（此帐号密码需要提供给所有禅道登录人员）才可以访问到禅道登录页面（登录页面需要输入禅道的登录帐号方可登录，默认登录禅道帐号：admin 123456）。<img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_c9c763f3eb0a20a2eaf6c0434cbc9617.png\" alt=\"\" width=\"424\" height=\"243\" /><img src=\"https://www.zentao.net/file.php?f=201807/f_426d924218c2fb46b500b5e46993733c&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /><br /></li>\n</ul><ul style=\"color:#333333;\"><li>如果需要修改Apache用户访问验证的账号和密码，可以在运行集成面板<span style=\"font-weight:700;\">最后一行的“更改”按钮</span>&nbsp;进行修改。</li>\n</ul><p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_6fd4ebe00fba6044636b8968cb565f82.png\" alt=\"\" width=\"424\" height=\"41\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">4、超级管理员登录密码修改</span></p>\n<p style=\"color:#333333;\">超级管理员登录禅道后，一键安装包默认的账号密码是admin，123456。</p>\n<p style=\"color:#333333;\">系统会检测密码安全级别，提示修改弱口令密码，按照提示修改即可。</p>\n<p style=\"color:#333333;\">如果需要维护密码安全设置可以到&nbsp;<span style=\"font-weight:700;\">后台--安全</span>&nbsp;页面进行修改。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_f42a26fa7d182d4cbb31fd9e2e7e917e&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_6b02c43743b66b9468396e004f27c2e0&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">5、登录禅道数据库</span></p>\n<p style=\"color:#333333;\">禅道Windows一键安装包默认只能在服务器本机登录。</p>\n<p style=\"color:#333333;\">浏览器里输入<span style=\"font-weight:700;\">http://127.0.0.1:端口号（apache端口为非80端口时，需要填写端口号）</span>，然后点击登录页面左下的&nbsp;<span style=\"font-weight:700;\">数据库管理</span>。</p>\n<p style=\"color:#333333;\">即可进入禅道数据库登录页面。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_8da45dcf4b40c0f0fe72baa0fd60f3c4.png&amp;t=png\" alt=\"\" width=\"550\" height=\"276\" /></p>\n<p style=\"color:#333333;\">在登录页面填写<span style=\"font-weight:700;\">&nbsp;xampp/zentao/config/my.php</span>&nbsp;里的对应参数，即可进入禅道数据库。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">系 &nbsp; &nbsp;统：</span>默认选择MySQL。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">服务器：</span>对应填写下图的$config-&gt;db-&gt;host和port的参数。比如下图$config-&gt;db-&gt;host = \'127.0.0.1\'，$config-&gt;db-&gt;port = \'3306\'。那么服务器填写：127.0.0.1:3306。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">用户名：</span>对应填写下图的$config-&gt;db-&gt;user = \'zentao\'。那么用户名就应该填写zentao。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">密 &nbsp; &nbsp;码：</span>对应填写下图的$config-&gt;db-&gt;password = \' \'，中单引号里的值。（每个人的数据库密码会不一样，单引号里显示的值是什么，密码就填写什么）</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">数据库：</span>对应填写下图的$config-&gt;db-&gt;name = \'zentao \'中的zentao 。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_66d27bd958b83d2c6986186826cd2c1a.png&amp;t=png\" alt=\"\" width=\"469\" height=\"293\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">需要注意的情况：</span></p>\n<p style=\"color:#333333;\">如果准备登录禅道数据库时，<span style=\"font-weight:700;\">登录界面里显示为黄底的内容，是浏览器自动填充的数据</span>。</p>\n<p style=\"color:#333333;\">这里填充的用户名和密码，其实和禅道的数据库用户名和密码是不一样的。</p>\n<p style=\"color:#333333;\">如果不做修改直接登录的话，是没有办法登录到禅道数据库的。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">请按照以上的说明，填写禅道数据库登录的参数。</span></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_665b750ae4dba727842580e6266a2dba.png&amp;t=png\" alt=\"\" width=\"608\" height=\"307\" /></p>\n<h4>二、未加安全设置的Windows一键安装包的安装(9.2.stable以上版本的未加安全设置包 9.2.stable以前的一键安装包）</h4>\n<p style=\"color:#333333;\">2.1 在我们的站点下载新的windows集成运行环境(.exe结尾)。</p>\n<p style=\"color:#333333;\">2.2<span style=\"color:#E56600;\">&nbsp;</span><span style=\"font-weight:700;\"><span style=\"color:#E56600;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp，</span><span style=\"color:#E56600;\">&nbsp;</span><span style=\"color:#E56600;\">必须是根目录</span><span style=\"color:#E56600;\">。</span></span></p>\n<p style=\"color:#333333;\">2.3 进入xampp文件夹，双击start.bat（新的windows一键安装包右键以管理员身份运行 启动禅道.exe）启动集成面板程序，界面如下：<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_c791981d982ba2b62264624cf33a554a.png\" alt=\"\" width=\"393\" height=\"258\" /></p>\n<p style=\"color:#333333;\">2.4 修改apache和mysql的启动端口(注意：默认系统会自动切换可以使用的端口，如果需要指定特定端口可以按以下步骤操作)：<br />1)、点击集成面板（运行xampp/启动禅道.exe后出现的控制台）左上角 服务-卸载服务；<br />2)、点击集成面板左上角 服务-配置默认端口，修改端口号后保存；<br />3)、退出集成面板后重新以管理员身份运行 xampp/启动禅道.exe；<br />4)、点击启动禅道。</p>\n<h4>三、启动并访问禅道</h4>\n<p style=\"color:#333333;\">3.1 启动集成面板之后，点击“启动禅道”按钮，系统会自动启动禅道所需要的apache和mysql服务。</p>\n<p style=\"color:#333333;\">3.2 启动成功之后，点击“访问禅道”，即可打开禅道环境的首页。5秒钟之后，页面会自动跳转到禅道的页面。<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_7f380746603ace52684a81d2f7bd9258.png\" alt=\"\" width=\"435\" height=\"180\" /></p>\n<p style=\"color:#333333;\">3.3 修改端口操作步骤：运行 xampp/start.exe 后 左上角 服务-卸载服务&nbsp; 然后 服务-配置默认端口 保存后 退出重新运行 xampp/start.exe&nbsp; 点击 启动禅道 。</p>\n<h4>四、相关密码</h4>\n<p style=\"color:#333333;\">4.1 禅道项目管理软件的登录帐号是<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">admin</span></span>,密码是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">123456</span></span>，请登录之后尽快修改自己的密码。</p>\n<p style=\"color:#333333;\">4.2 mysql数据库的管理员默认帐号是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">root</span></span>，密码为<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">&nbsp;123456</span></span>。(如果您修改了root帐号的密码，请一定记得修改zentao/config/my.php里面的数据库密码)</p>\n<p style=\"color:#333333;\">4.3&nbsp;数据库管理是使用的phpmyadmin程序，基于安全方面的考虑，只能在禅道所在的机器上面访问，从其他机器访问会被禁止。（禅道服务器本机浏览器访问127.0.0.1，点击数据库管理。）</p>\n<h4>五、关于该环境</h4>\n<p style=\"color:#333333;\">5.1 禅道访问地址为<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">http://禅道机器的ip地址:端口号/zentao/</span></span>，ip地址换成禅道机器实际的ip地址，端口号换成实际的端口号。（查看电脑IP地址方法：http://jingyan.baidu.com/article/63f2362816d56c0208ab3dd5.html）</p>\n<p style=\"color:#333333;\">5.2 该集成面板会自动安装apache和mysql为服务，服务名分别是apachezt, mysqlzt。</p>\n<p style=\"color:#333333;\">5.3 该环境是从<a href=\"http://www.apachefriends.org/\" target=\"_blank\" rel=\"noreferrer noopener\">xampp</a>版本精简而来。</p>\n<h4>六、如果集成面板失败</h4>\n<p style=\"color:#333333;\">如果无法通过集成面板启动禅道程序，我们还提供了命令行的控制脚本来启动禅道：</p>\n<p style=\"color:#333333;\">6.1 切换到xampp\\service目录</p>\n<p style=\"color:#333333;\">6.2&nbsp;双击install.bat这个脚本，系统会自动尝试安装apache和mysql为服务，并启动。</p>\n<p style=\"color:#333333;\">6.3&nbsp;安装成功之后，在这个目录下面会有port.apache和port.mysql来记录apache和mysql的端口号，如果您想更改端口，可以将这两个文件删掉，重新运行install.bat脚本。</p>','<p style=\"color:#333333;\">为了简化大家在windows下面的安装，我们在xampp基础上做了禅道的windows一键安装包。xampp是业内非常著名的AMP集成运行环境。禅道的一键安装包主要在它基础上做了大量的精简，并集成了我们自主开发的集成面板，使用起来会更加方便。关于xampp一键安装包，大家有兴趣可以访问下面的官方网站：<a target=\"_blank\" href=\"https://www.apachefriends.org/\" rel=\"noreferrer noopener\">https://www.apachefriends.org/</a>&nbsp;（注：这个是xampp官方网站，禅道一<span style=\"line-height:24.4444px;\">键</span>安装包不需要登录这个网址下载）。</p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\">禅道9.2.stable版本升级了Windows一键安装包。</p>\n<p style=\"color:#333333;\">禅道运行集成面板升级到2.0.0版本，我们有针对64位和32位分别打包，请根据自己的电脑下载对应的Windows一键安装包。</p>\n<p style=\"color:#333333;\">启用Apache用户验证，修改mysql密码的功能，新安装时会提示安装VC环境。</p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">注：</span></span></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\"><span style=\"color:#E53333;\">windows一键安装包中已经集成了XXD服务，不需要再单独安装部署XXD。windows操作系统，server版本建议采用2012或2016及以上。</span></span></p>\n<h4>一、Windows 64/32位一键安装包的安装<br /></h4>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">1、运行Windows一键安装包</span></p>\n<p style=\"color:#333333;\">在我们的站点下载新的windows集成运行环境(.exe结尾)。<br /><span style=\"font-weight:700;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp， 必须是根目录。</span><br />&nbsp;进入xampp文件夹，点击 start.exe启动禅道时，如果电脑没有安装过VC运行环境时，会提示安装VC  环境。</p>\n<p style=\"color:#333333;\">Windows一键安装包的运行需要安装VC  环境。</p>\n<p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201705/f_fa49d52b26735bfd17260694410e7098.png\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"background-color:#FFE500;\">注意：</span><span style=\"background-color:#FFE500;\">如果您遇到以下界面，请删除当前xampp包，然后下载&nbsp;</span><span style=\"font-weight:700;\"><span style=\"background-color:#FFE500;\">windows一键安装包（未加安全设置）</span></span><span style=\"background-color:#FFE500;\">的包安装使用。</span></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_c44c31da4a8af894172aaa641fd88306&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_bc7323ac7ce0a47b11ce9dace87b91d2&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201802/f_da7f0402e6e83958e2528bd9ae358f06&amp;t=png&amp;o=&amp;s=&amp;v=1518144053\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><br /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">2、修改数据库密码</span></p>\n<p style=\"color:#333333;\">禅道服务启动后，会提示数据库密码太弱，建议修改密码。</p>\n<p style=\"color:#333333;\">会默认显示一个密码，你也可以自己设置一个密码，点OK后数据库密码会自动修改。</p>\n<p style=\"color:#333333;\">可以在控制运行面板左上角服务--修改数据库密码里查看到当前的数据库密码。也可以在xampp/zentao/config/my.php里查看到数据库密码。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_185c49b6ffbf4cbf2565cafab8231bc1&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">3、</span><span style=\"font-weight:700;\">Apache用户访问验证（注：未加安全设置的一键安装包无此功能）</span></p>\n<p style=\"color:#333333;\">禅道启动后，默认是开启了Apache用户访问验证，如下图：</p>\n<ul style=\"color:#333333;\"><li>如果不想开启访问验证功能，可以把<span style=\"font-weight:700;\">集成面板最后一行左侧</span>的对号去掉。<br /></li>\n</ul><ul style=\"color:#333333;\"><li>启用访问验证后，用户需要先输入集成面板最后一行的帐号密码（此帐号密码需要提供给所有禅道登录人员）才可以访问到禅道登录页面（登录页面需要输入禅道的登录帐号方可登录，默认登录禅道帐号：admin 123456）。<img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_c9c763f3eb0a20a2eaf6c0434cbc9617.png\" alt=\"\" width=\"424\" height=\"243\" /><img src=\"https://www.zentao.net/file.php?f=201807/f_426d924218c2fb46b500b5e46993733c&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /><br /></li>\n</ul><ul style=\"color:#333333;\"><li>如果需要修改Apache用户访问验证的账号和密码，可以在运行集成面板<span style=\"font-weight:700;\">最后一行的“更改”按钮</span>&nbsp;进行修改。</li>\n</ul><p style=\"color:#333333;\"><img src=\"https://cdn.easycorp.cn/web/data/upload/201802/f_6fd4ebe00fba6044636b8968cb565f82.png\" alt=\"\" width=\"424\" height=\"41\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">4、超级管理员登录密码修改</span></p>\n<p style=\"color:#333333;\">超级管理员登录禅道后，一键安装包默认的账号密码是admin，123456。</p>\n<p style=\"color:#333333;\">系统会检测密码安全级别，提示修改弱口令密码，按照提示修改即可。</p>\n<p style=\"color:#333333;\">如果需要维护密码安全设置可以到&nbsp;<span style=\"font-weight:700;\">后台--安全</span>&nbsp;页面进行修改。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_f42a26fa7d182d4cbb31fd9e2e7e917e&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201807/f_6b02c43743b66b9468396e004f27c2e0&amp;t=png&amp;o=&amp;s=&amp;v=1530496689\" alt=\"\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">5、登录禅道数据库</span></p>\n<p style=\"color:#333333;\">禅道Windows一键安装包默认只能在服务器本机登录。</p>\n<p style=\"color:#333333;\">浏览器里输入<span style=\"font-weight:700;\">http://127.0.0.1:端口号（apache端口为非80端口时，需要填写端口号）</span>，然后点击登录页面左下的&nbsp;<span style=\"font-weight:700;\">数据库管理</span>。</p>\n<p style=\"color:#333333;\">即可进入禅道数据库登录页面。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_8da45dcf4b40c0f0fe72baa0fd60f3c4.png&amp;t=png\" alt=\"\" width=\"550\" height=\"276\" /></p>\n<p style=\"color:#333333;\">在登录页面填写<span style=\"font-weight:700;\">&nbsp;xampp/zentao/config/my.php</span>&nbsp;里的对应参数，即可进入禅道数据库。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">系 &nbsp; &nbsp;统：</span>默认选择MySQL。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">服务器：</span>对应填写下图的$config-&gt;db-&gt;host和port的参数。比如下图$config-&gt;db-&gt;host = \'127.0.0.1\'，$config-&gt;db-&gt;port = \'3306\'。那么服务器填写：127.0.0.1:3306。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">用户名：</span>对应填写下图的$config-&gt;db-&gt;user = \'zentao\'。那么用户名就应该填写zentao。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">密 &nbsp; &nbsp;码：</span>对应填写下图的$config-&gt;db-&gt;password = \' \'，中单引号里的值。（每个人的数据库密码会不一样，单引号里显示的值是什么，密码就填写什么）</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">数据库：</span>对应填写下图的$config-&gt;db-&gt;name = \'zentao \'中的zentao 。</p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_66d27bd958b83d2c6986186826cd2c1a.png&amp;t=png\" alt=\"\" width=\"469\" height=\"293\" /></p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">需要注意的情况：</span></p>\n<p style=\"color:#333333;\">如果准备登录禅道数据库时，<span style=\"font-weight:700;\">登录界面里显示为黄底的内容，是浏览器自动填充的数据</span>。</p>\n<p style=\"color:#333333;\">这里填充的用户名和密码，其实和禅道的数据库用户名和密码是不一样的。</p>\n<p style=\"color:#333333;\">如果不做修改直接登录的话，是没有办法登录到禅道数据库的。</p>\n<p style=\"color:#333333;\"><span style=\"font-weight:700;\">请按照以上的说明，填写禅道数据库登录的参数。</span></p>\n<p style=\"color:#333333;\"><img src=\"https://www.zentao.net/file.php?f=201707/f_665b750ae4dba727842580e6266a2dba.png&amp;t=png\" alt=\"\" width=\"608\" height=\"307\" /></p>\n<h4>二、未加安全设置的Windows一键安装包的安装(9.2.stable以上版本的未加安全设置包 9.2.stable以前的一键安装包）</h4>\n<p style=\"color:#333333;\">2.1 在我们的站点下载新的windows集成运行环境(.exe结尾)。</p>\n<p style=\"color:#333333;\">2.2<span style=\"color:#E56600;\">&nbsp;</span><span style=\"font-weight:700;\"><span style=\"color:#E56600;\">双击解压缩到某一个分区的根目录，比如c:\\xampp，或者d:\\xampp，</span><span style=\"color:#E56600;\">&nbsp;</span><span style=\"color:#E56600;\">必须是根目录</span><span style=\"color:#E56600;\">。</span></span></p>\n<p style=\"color:#333333;\">2.3 进入xampp文件夹，双击start.bat（新的windows一键安装包右键以管理员身份运行 启动禅道.exe）启动集成面板程序，界面如下：<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_c791981d982ba2b62264624cf33a554a.png\" alt=\"\" width=\"393\" height=\"258\" /></p>\n<p style=\"color:#333333;\">2.4 修改apache和mysql的启动端口(注意：默认系统会自动切换可以使用的端口，如果需要指定特定端口可以按以下步骤操作)：<br />1)、点击集成面板（运行xampp/启动禅道.exe后出现的控制台）左上角 服务-卸载服务；<br />2)、点击集成面板左上角 服务-配置默认端口，修改端口号后保存；<br />3)、退出集成面板后重新以管理员身份运行 xampp/启动禅道.exe；<br />4)、点击启动禅道。</p>\n<h4>三、启动并访问禅道</h4>\n<p style=\"color:#333333;\">3.1 启动集成面板之后，点击“启动禅道”按钮，系统会自动启动禅道所需要的apache和mysql服务。</p>\n<p style=\"color:#333333;\">3.2 启动成功之后，点击“访问禅道”，即可打开禅道环境的首页。5秒钟之后，页面会自动跳转到禅道的页面。<br /><img src=\"https://cdn.easycorp.cn/web/data/upload/201512/f_7f380746603ace52684a81d2f7bd9258.png\" alt=\"\" width=\"435\" height=\"180\" /></p>\n<p style=\"color:#333333;\">3.3 修改端口操作步骤：运行 xampp/start.exe 后 左上角 服务-卸载服务&nbsp; 然后 服务-配置默认端口 保存后 退出重新运行 xampp/start.exe&nbsp; 点击 启动禅道 。</p>\n<h4>四、相关密码</h4>\n<p style=\"color:#333333;\">4.1 禅道项目管理软件的登录帐号是<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">admin</span></span>,密码是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">123456</span></span>，请登录之后尽快修改自己的密码。</p>\n<p style=\"color:#333333;\">4.2 mysql数据库的管理员默认帐号是<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">root</span></span>，密码为<span style=\"font-weight:700;\"><span style=\"color:#E53333;\">&nbsp;123456</span></span>。(如果您修改了root帐号的密码，请一定记得修改zentao/config/my.php里面的数据库密码)</p>\n<p style=\"color:#333333;\">4.3&nbsp;数据库管理是使用的phpmyadmin程序，基于安全方面的考虑，只能在禅道所在的机器上面访问，从其他机器访问会被禁止。（禅道服务器本机浏览器访问127.0.0.1，点击数据库管理。）</p>\n<h4>五、关于该环境</h4>\n<p style=\"color:#333333;\">5.1 禅道访问地址为<span style=\"color:#E53333;\"><span style=\"font-weight:700;\">http://禅道机器的ip地址:端口号/zentao/</span></span>，ip地址换成禅道机器实际的ip地址，端口号换成实际的端口号。（查看电脑IP地址方法：http://jingyan.baidu.com/article/63f2362816d56c0208ab3dd5.html）</p>\n<p style=\"color:#333333;\">5.2 该集成面板会自动安装apache和mysql为服务，服务名分别是apachezt, mysqlzt。</p>\n<p style=\"color:#333333;\">5.3 该环境是从<a href=\"http://www.apachefriends.org/\" target=\"_blank\" rel=\"noreferrer noopener\">xampp</a>版本精简而来。</p>','071- <del><h4>六、如果集成面板失败</h4></del>\n072- <del><p style=\"color:#333333;\">如果无法通过集成面板启动禅道程序，我们还提供了命令行的控制脚本来启动禅道：</p></del>\n073- <del><p style=\"color:#333333;\">6.1 切换到xampp\\service目录</p></del>\n074- <del><p style=\"color:#333333;\">6.2双击install.bat这个脚本，系统会自动尝试安装apache和mysql为服务，并启动。</p></del>\n075- <del><p style=\"color:#333333;\">6.3安装成功之后，在这个目录下面会有port.apache和port.mysql来记录apache和mysql的端口号，如果您想更改端口，可以将这两个文件删掉，重新运行install.bat脚本。</p></del>'),(112,206,'content','https://www.baidu.com','https://www.ucamp.cn/guide/25-must-have-apps-for-china-students-40.html','001- <del>https://www.baidu.com</del>\n001+ <ins>https://www.